en=\"2021-01-20T14:40:11+09:00\" stEvt:softwareAgent=\"Adobe Photoshop 21.0 (Windows)\" stEvt:changed=\"/\"/> <rdf:li stEvt:action=\"converted\" stEvt:parameters=\"from application/vnd.adobe.photoshop to image/jpeg\"/> <rdf:li stEvt:action=\"derived\" stEvt:parameters=\"converted from application/vnd.adobe.photoshop to image/jpeg\"/> <rdf:li stEvt:action=\"saved\" stEvt:instanceID=\"xmp.iid:4b9ba0c0-7471-6746-9392-b2c1480e1488\" stEvt:when=\"2021-01-20T14:40:11+09:00\" stEvt:softwareAgent=\"Adobe Photoshop 21.0 (Windows)\" stEvt:changed=\"/\"/> </rdf:Seq> </xmpMM:History> <photoshop:TextLayers> <rdf:Bag> <rdf:li photoshop:LayerName=\"착한강의를 위한 매일 마시는 꿀팁 한 모금. \" photoshop:LayerText=\"착한강의를 위한 매일 마시는 꿀팁 한 모금. \"/> <rdf:li photoshop:LayerName=\"수강생의 이름을 불러주어 커뮤니케이션이 원활이 될 수 있도록 하고 수강생이 관심 받고 있다는 느낌이 들게끔 만들어\" photoshop:LayerText=\"수강생의 이름을 불러주어 커뮤니케이션이 원활이 될 수 있도록 하고 수강생이 관심 받고 있다는 느낌이 들게끔 만들어 줍니다. \"/> <rdf:li photoshop:LayerName=\"수강생은 지난 시간 강의 리뷰를 통해 복습하는 시간을 갖고, 프리뷰를 통해 다음시간 수업내용을 파악하여 수업 흥미\" photoshop:LayerText=\"수강생은 지난 시간 강의 리뷰를 통해 복습하는 시간을 갖고, 프리뷰를 통해 다음시간 수업내용을 파악하여 수업 흥미를 높일 수 있습니다. \"/> <rdf:li photoshop:LayerName=\"수강생들은 항상 실무에서의 이야기, 강사의 실무 경험, 예시를 듣고싶어 하며, 오늘 배운 내용이 어떤식으로 실무에\" photoshop:LayerText=\"수강생들은 항상 실무에서의 이야기, 강사의 실무 경험, 예시를 듣고싶어 하며, 오늘 배운 내용이 어떤식으로 실무에 쓰이는지 설명해 준다면 이해와 흥미를 높일 수 있습니다.\"/> <rdf:li photoshop:LayerName=\"수강생의 이름 불러주기!\" photoshop:LayerText=\"수강생의 이름 불러주기!\"/> <rdf:li photoshop:LayerName=\"1\" photoshop:LayerText=\"1\"/> <rdf:li photoshop:LayerName=\"강의내용 리뷰, 프리뷰 생활화하기!\" photoshop:LayerText=\"강의내용 리뷰, 프리뷰 생활화하기!\"/> <rdf:li photoshop:LayerName=\"2\" photoshop:LayerText=\"2\"/> <rdf:li photoshop:LayerName=\"강의 내용에 실무 경험 곁들이기!\" photoshop:LayerText=\"강의 내용에 실무 경험 곁들이기!\"/> <rdf:li photoshop:LayerName=\"3\" photoshop:LayerText=\"3\"/> <rdf:li photoshop:LayerName=\"친절 한 모금, 미소 한 모금 착한 강의 캠페인\" photoshop:LayerText=\"친절 한 모금, 미소 한 모금 착한 강의 캠페인\"/> </rdf:Bag> </photoshop:TextLayers> <photoshop:DocumentAncestors> <rdf:Bag> <rdf:li>adobe:do