 photoshop:LayerText=\"수강생은 지난 시간 강의 리뷰를 통해  복습하는 시간을 갖고,  프리뷰를 통해 다음시간 수업내용을 파악하여  수업 흥미를 높일 수 있습니다. \"/> <rdf:li photoshop:LayerName=\"강의내용 리뷰, 프리뷰 생활화하기!\" photoshop:LayerText=\"강의내용 리뷰, 프리뷰 생활화하기!\"/> <rdf:li photoshop:LayerName=\"2\" photoshop:LayerText=\"2\"/> <rdf:li photoshop:LayerName=\"수강생들은 항상 실무에서의 이야기, 강사의 실무 경험, 예시를 듣고 싶어 하며,  오늘 배운 내용이 어떤식으로 실\" photoshop:LayerText=\"수강생들은 항상 실무에서의 이야기, 강사의 실무 경험, 예시를 듣고 싶어 하며,  오늘 배운 내용이 어떤식으로 실무에 쓰이는지 설명해 준다면 이해와 흥미를 높일 수 있다. \"/> <rdf:li photoshop:LayerName=\"강의 내용에 실무 경험 곁들이기!\" photoshop:LayerText=\"강의 내용에 실무 경험 곁들이기!\"/> </rdf:Bag> </photoshop:TextLayers> <photoshop:DocumentAncestors> <rdf:Bag> <rdf:li>0F3169ACE6153C918EC74DC91610AAC9</rdf:li> <rdf:li>E414704E88FDD72D4785C1BB85018A58</rdf:li> <rdf:li>adobe:docid:photoshop:c05f46f3-ee26-cc48-8e92-1d63aabf9ae3</rdf:li> <rdf:li>xmp.did:0C534E01A835EA118630B8155E05B6AF</rdf:li> <rdf:li>xmp.did:d1a7fbd2-c71e-d946-b977-f7f304acb2f0</rdf:li> <rdf:li>xmp.did:e11ec46c-c45e-5d4b-8f40-b3984a066a5d</rdf:li> </rdf:Bag> </photoshop:DocumentAncestors> </rdf:Description> </rdf:RDF> </x:xmpmeta>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                     